import React from 'react';
import 'antd/dist/antd.css';
import styled from 'styled-components'



const Header = styled.header`
background: #1f2229;
height: 50px;
font-size: 13px;
position: relative;
z-index: 2;
display: flex;
box-sizing: border-box;

`


export default Header
